import React, {  useState } from 'react';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, Collapse, Divider, Box, Typography } from '@mui/material';
import { ExpandMore, ExpandLess } from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';
import "../styles/SideMenu.css";

const Sidebar = () => {
  const [expandedMenu, setExpandedMenu] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();
   const menuItems = [

    {
      id:'BPTApplication Report',
      label:'BPTApplication Report',
      hasMenu: true,
      subItems: [
        {id:'BPT Application Report' ,label:'BPT Application Report', path:'/bptapplication' }
      ]
    },

    {
      id: 'Certificates',
      label: 'Certificates',
      hasSubMenu: true,
      subItems: [

        { id: 'TransferCertificate', label: 'TransferCertificate', path: '/' },
        {id:'Bonafide', label:'Bonafide', path:'/bonafide'},
        {id:'Internship', label:'Internship',path:'/int'}

      ]
    },


    {
      id: 'Nursing(Bsc)-4YDC',
      label: 'Nursing(Bsc)-4YDC',
      hasSubMenu: true,
      subItems: [

        { id: 'NursingSemester1', label: 'Semester 1', path: '/nursingsem1' },
        { id:'NursingSemester2' , label: 'Semester 2', path: '/nursingsem2'},
        { id: 'NursingSemester3', label: 'Semester 3', path: '/nursingsem3' },
        { id: 'NursingSemester4', label: 'Semester 4', path: '/nursingsem4' },
      ]
    },
    { 
      id:'Nursing(Bsc)',
      label:'Nursing(Bsc)',
      hasSubMenu:true,
      subItems: [
        { id: 'NursingSecondYear', label: ' NursingSecondyear', path: '/nurs2y' },
        { id: 'NursingThirdYear', label:  'NursingThirdyear'  , path: '/nurs3y' },
        { id: 'NursingFourthYear', label: 'NursingFourthyear' , path: '/nurs4y' },
      ]
    },

    {
      id: 'Physiotherapy(BPT)',
      label: 'Physiotherapy(BPT)',
      hasSubMenu: true,
      subItems: [

        { id: 'BPTemester1', label: 'Semester 1', path: '/bpt1' },
        { id: 'BPTSemester2', label: 'Semester 2', path: '/bpt2' },
        { id: 'BPTSemester3', label: 'Semester 3', path: '/bpt3' },
        { id: 'BPTSemester4', label: 'Semester 4', path: '/bpt4' },
        { id: 'BPTSemester5', label: 'Semester 5', path: '/bpt5' },
        { id: 'BPTSemester6', label: 'Semester 6', path: '/bpt6' },
        { id: 'BPTSemester7', label: 'Semester 7', path: '/bpt7' },
        { id: 'BPTSemester8', label: 'Semester 8', path: '/bpt8' },

      ]
    },

    { 
      id:'Anesthesia(Bsc)',
      label:'Anesthesia(Bsc)',
      hasSubMenu:true,
      subItems: [
        { id: 'AnesthesiaFirstYear', label: 'AnesthesiaFirstYear', path: '/anesthesia1' },
        { id: 'AnesthesiaSecondYear', label: 'AnesthesiaSecondYear', path: '/anesthesia2' },
        { id:'AnesthesiaThirdYear' , label:'AnesthesiaThirdYear', path:'/anesthesia3'},

      ]
    },
    { 
      id:'Medical Laboratory Technology(Bsc)',
      label:'Medical Laboratory Technology(Bsc)',
      hasSubMenu:true,
      subItems: [

        { id: 'MLTSecondYear', label: 'MLTSecondYear', path: '/mlt2' },
        { id: 'MLTThirdYear', label: 'MLTThirdYear', path: '/mlt3' },
      ]
    },


    { 
      id:'HospitalManagementCourse',
      label:'HospitalManagementCourse',
      hasSubMenu:true,
      subItems: [
        { id: 'HMCFirstYearSemester1', label: ' HMCFirstYearSemester1', path: '/hmc1' },
        { id: 'HMCFirstYearSemester2', label: ' HMCFirstYearSemester2', path: '/hmc2' },
        { id: 'HMCSecondYearSemester3', label: ' HMCSecondYearSemester3', path: '/hmc3' },
        { id: 'HMCSecondYearSemester4', label: ' HMCSecondYearSemester4', path: '/hmc4' },
      ]
    },


    { 
      id:'Master of Physiotherapy ',
      label:'Master of Physiotherapy(MPT)',
      hasSubMenu:true,
      subItems: [
        { id: 'MPTFirstYear', label: ' MPTFirstYear', path: '/mpt1' },
        { id: 'MPTSecondYear', label: ' MPTSecondYear', path: '/mpt2' },

      ]
    },
    { 
      id:'Nuclear Medicine Technology(PG)',
      label:'Nuclear Medicine Technology(PG)',
      hasSubMenu:true,
      subItems: [
        { id: 'NMTTFirstYear', label: ' NMTFirstYear', path: '/nmt1' },
        { id: 'NMTSecondYear', label: ' NMTSecondYear', path: '/nmt2' },

      ]
    },

    { 
      id:'Genetic Counselling Course',
      label:'Genetic Counselling Course',
      hasSubMenu:true,
      subItems: [
        { id: 'GeneticCounsellingCourse', label: ' GeneticCounsellingCourse', path: '/genetic' },
      ]
    },
  ];

  const handleMenuClick = (item) => {
    if(item.hasSubMenu) {
      setExpandedMenu(expandedMenu === item.id ? null : item.id);
    }
    else{
      handleNavigation(item.path);
    }
  };

  const handleNavigation = (path) => {
    navigate(path);
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <Drawer variant="permanent" className = "custom-drawer">
      <Box sx={{ overflow: 'auto' }}>
        <List>
          {menuItems.map((item) => (
            <React.Fragment key={item.id}>
              <ListItem button onClick={() => handleMenuClick(item)} selected={!item.hasSubMenu && isActive(item.path) || 
                  (item.hasSubMenu && item.subItems.some(sub => isActive(sub.path)))} className = "listitem_hover"
              >
                <ListItemText primary={item.label} className = "listitem_label" />
                  {item.hasSubMenu && ( expandedMenu === item.id ? <ExpandLess /> : <ExpandMore /> )}
                </ListItem>
                {item.hasSubMenu && (
                  <Collapse in={expandedMenu === item.id} timeout="auto" unmountOnExit>
                    <List component="div" disablePadding sx = {{backgroundColor : "#ede0fe"}}>
                      {item.subItems.map((subItem) => (
                        <ListItem key={subItem.id} button sx={{ pl: 4 }} onClick={() => handleNavigation(subItem.path)}
                          selected={isActive(subItem.path)} className = "listitem_hover">
                          <ListItemText primary={subItem.label} />
                        </ListItem>
                      ))}
                    </List>
                  </Collapse>
                )}
            </React.Fragment>
          ))}
        </List>
      </Box>
    </Drawer>
  );
};

export default React.memo(Sidebar);
